Plugin Exercises!Este plugin permite introducir ejercicios interactivos, a modo de que el lector pueda, por ejemplo, escribir la solución de un problema para posteriormente el autor del gitbook pueda verificarla y validarla.primary::¿Cómo podemos instalar este plugin?
Debemos instalar el siguiente paquete  y añadirlo a nuestro package.json:$ npm install gitbook-plugin-exercises --save-devUna vez instalado, debemos incorporar el plugin en nuestro fichero book.json{  
  "plugins": ["exercises"]
} 
Finalmente, ejecutamos el siguiente comando para instalar y preparar el plugin:$ gitbook install



