section5/youtube.html.body:
primary::Plugin Youtube!
Este plugin permite introducir contenidos del sitio web Youtube, como por ejemplo, videos.¿Cómo podemos instalar este plugin?Debemos instalar el siguiente paquete  y añadirlo a nuestro package.json: 

$ npm install gitbook-plugin-youtube --save-dev
Una vez instalado, debemos incorporar el plugin en nuestro fichero book.json

{
    "plugins": ["youtube"]
}
Finalmente, ejecutamos el siguiente comando para instalar y preparar el plugin:

$ gitbook install
